import React from 'react';
import Speaker from './SVG Files/Speaker + stand.svg';
import Booth from './SVG Files/Booth.svg';
import SpeakerWithBass from './SVG Files/Speaker + bass.svg';
import MovingHead from './SVG Files/Moving head.svg';
import Gigbar from './SVG Files/Gigbar with stand.svg';

import { FC } from 'react';

type allowedStrings = "Speaker" | "Booth" | 'SpeakerWithBass' | "MovingHead" | "Gigbar";


const EquipmentComponent:FC<{component: allowedStrings}> = (props) => {
    //have a switch statement that returns the correct svg based on the props.component
    //return the correct svg

    switch (props.component) {
        case "Speaker":
            return <img src={Speaker}/>
        case "Booth":
            return <img src={Booth}/>
        case "SpeakerWithBass":
            return <img src={SpeakerWithBass}/>
        case "MovingHead":
            return <img src={MovingHead}/>
        case "Gigbar":
            return <img src={Gigbar}/>
        default:
            return <img src={Speaker}/>


    }
}

export default EquipmentComponent;
